import TopButtonGroup from "../molecules/topButtonGroup";
import MainText from "../molecules/mainText";
import ApplyButton from "../atoms/applyButton";
import ProgressBar from "../atoms/progressBar";
const Main = () => {
    return(
        <div>
            <TopButtonGroup />
            <ProgressBar select={'main'}/>
            <MainText />
            <ApplyButton />
        </div>
    )
}
export default Main;
